import React from "react";

function Transaction({props}) {
  return (
    <tr className="bank-font">
      <td >{props.date}</td>
      <td>{props.description}</td>
      <td>{props.category}</td>
      <td>{props.amount}</td>
    </tr>
  );
}

export default Transaction;
